Male: (measurements of 
5 specimens
) length 5.98–7.01 (6.28) mm; maximum width 110–170 (150); length of cephalic vesicle 70–80 (75); length of oesophagus 310–370 (340); deirids, nerve ring and excretory pore 310–370 (340), 175–240 (208) and 290–360 (330) from anterior end respectively. Spicules 230–310 (270) long, calomus 85–105 (95), lamina 200–250 (225); gubernaculum 40–65 (52) long. Bursa symmetrical; bursal pattern of 
type
1–4 in
both lobes with right ray 3 diverging at same level as right ray 6 and left ray 3 proximally to left ray 6; right ray 2 much thicker than left; right ray 4 more robust than left ray; rays 8 arising from common trunk of rays 2–6; dorsal ray very short; rays 9 arising asymetrically on dorsal ray, right ray 9 arising first; then dorsal ray branching in distal quarter with 2 branchlets, each branchlet branching in distal quarter with elongate, digitiform external pair (rays 10) and usually with short internal pair (phasmid) (
Fig. 16F
). Genital cone prominent; tip thickened and opaque but not heavily sclerotised; papillae 7 paired on tiny, conical projections 
Figs. 16G, H
). Spicules, dark brown in colour, short; tips sharply pointed (
Fig. 16D
). Gubernaculum well sclerotised, quadrangular in median view (
Fig. 16I, J
).

Female: (measurements of 
5 specimens
) length 6.83–7.56 (7.04) mm; maximum width 110–150 (130); length of cephalic vesicle 80 (80); length of oesophagus 320–390 (360); deirids, nerve ring and excretory pore 300–330 (320), 175–230 (205) and 270–320 (300) from anterior end respectively. Vulva 280–360 (330) from posterior end; (
Fig. 16E
); measurements from single female: vagina vera 40 long, vestibule 80 long, anterior sphincter 30 long, posterior sphincter 25 long, anterior infundibulum 78 long, posterior infundibulum 125 long; 2–8 (6) eggs in anterior uterus, 1–4 (2) in posterior uterus; eggs 70–75 (73) long, 40–55 (47) wide; tail 60–90 (77) long, conical with attenuated extremity (
Fig. 16E
); phasmids not visible.

