subSubSection.paragraph:
Right float with well-developed peduncle at mid-body (
Figs. 17F
, 
18F
). Floats of similar size at oesophagointestinal junction and at mid-body in male. Size of right float increasing to mid-body, remaining constant to about 800 µm anterior to bursa, then decreasing in size and disappearing about 500 µm anterior to bursa (
Fig. 17K
). Size of left float increasing to about 500 µm anterior to bursa, then decreasing in size and disappearing at about 40 µm anterior to bursa (
Fig. 17L
). In female, size of right float increasing along two-thirds of body then decreasing to 100 µm anterior to vulva (
Fig. 18M
); size of left float increasing to mid-body then decreasing to 40 µm anterior to vulva (
Fig. 18N
).

Sequence of origin of ridges: in both sexes, from posterior margin of cephalic vesicle to 50 µm posterior to oesophago-intestinal junction; in male, ridges 2’ 3’, 4’, 5’ 2 (
Fig. 17A
), then 6’ (
Fig. 17B
), then 1’ (
Fig. 17C
), then 1 (
Fig. 17E
). In female, ridges 2’, 3’, 4’ (
Fig. 18B
), then 5’, 2 (
Fig. 18C
), then 1’, 6’ (
Fig. 18D
), then 1 (
Fig. 18E
).

Sequence of disappearance of ridges: in male, ridge 5’ at end of median third (
Fig. 17G
) then between 850 µm and 40 µm anterior to bursa (950 µm to 140 µm anterior to caudal extremity) ridges 4’, 1 (
Fig. 17H
), then 1’ (
Fig. 18I
), then 6’, 2 (
Fig. 17J
), then 2’, 3’ (
Fig. 17L
). In female, between 400 µm anterior to vulva (700 µm anterior to caudal extremity) and 140 µm anterior to vulva, ridges 4’, 5’ (
Fig. 18G
), then 1 (
Fig. 18H
), then 1’ (
Fig. 18I
), then 2’ (
Fig. 18J
), then 6’, 2 (
Fig. 18K
), then 3’(
Fig. 18L
).

Ridges disappear in the distal third of the body in the male and in the distal quarter in the female, except ridge 5’ which disappears at the end of the median third of the body in the male. In the male, ridges terminate anterior to the bursa, at which level, the both floats have disappeared (
Fig. 17L
). In the female, ridges are absent anterior to the vulva at which level, the both floats are absent (
Fig. 18N
).
